import React, { Component } from 'react';

// const data = require('./data.json')



class ButtonCore extends Component {
  render() {
    const value = this.props.type

    return (
      <div>
        <button onClick={() => this.props.onClick()}>{value}</button>
      </div>
    );
  }
}

export default ButtonCore;
